import React from 'react';

export default function About() {
    return (
      <div className="About-Container">
        <div className="About-item">My name is Jack Painter and I am a enthusiastic and passionate junior full-stack developer. 
        After more than 4 years of working on the sales side of IT, I decided enough was enough and made the decision to drop it all 
        and become a developer.Currently on an intensive full-stack development course with Kodiri where I am using JavaScript, React, Node, HTML and CSS to develop a netflix clone and a soon to be disclosed group project.</div>
        <div className="About-item">When I am not coding your find me taking photos(any tips/advice would be very welcome), listening to my vinyls, attending meetups and nervously watching Lando Norris(F1) or Arsenal(football).</div>
      </div>
    );
  }
